import React from 'react';
import './Contact.css';

function Contact(props) {
    const listItems = props.contacts.map((c) =>
        <p><a href={c.URL}>{c.Platform}</a></p>
    );

    return (
        // <div class="contact">
        //     <div class="contact_links">
        //         {listItems}
        //     </div>
        // </div>
        <div class="contact">
            <div class="pfp"></div>
        </div>
    );
}

export default Contact;
